import React, { useState, useEffect } from 'react';
import gallery from '../../Assets/low-angle-shot-mesmerizing-starry-sky.jpg';
import { MDBInput } from 'mdb-react-ui-kit';
import axios from 'axios';
import './AgentBooking.css'
const AgentBooking = () => {

    const [data, setData] = useState([]);
    const [selectedValue, setSelectedValue] = useState('');
  
    useEffect(() => {
      // Make an API call to fetch the data
      // Replace 'apiEndpoint' with your actual API endpoint
      fetch('apiEndpoint')
        .then((response) => response.json())
        .then((data) => setData(data))
        .catch((error) => console.error('Error fetching data:', error));
    }, []);

    const handleChange = (event) => {
        setSelectedValue(event.target.value);
      };


    return (
        <div>
            <div>
                <img src={gallery} className='gallery-img' alt='Gallery' />
            </div>
            <div className='book-head'>ADD PACKAGE</div>

            <div className='container mt-5'>
                <div className='booknow-box'>
                          <select value={selectedValue} onChange={handleChange}>
        <option value="">Select an option</option>
        {data.map((item) => (
          <option key={item.id} value={item.value}>
            {item.label}
          </option>
        ))}
      </select>
                    <div>
                        <MDBInput label='Package Name' id='typeText' type='text' />
                    </div>
                    
                    <div>
                    <MDBInput label='' id='typeText' type='file' />
                    </div>
                    <div>
                        <MDBInput label='Total Number of Person' id='typeText' type='number' />
                    </div>
                    <div>
                        <MDBInput label='Price Per Person' id='typeText' type='number' />
                    </div>
                    <div>
                        <MDBInput label='Person Limit' id='typeText' type='number' />
                    </div>

                    <br /><br />
                   
                    {/* Submit button */}
                    <button className='btn btn-primary mt-3 upload-cancel' >Submit</button>
                </div>
            </div>

        </div>

    )
}

export default AgentBooking
